How can I get a mongo subset of a collection based on an another collection<p>I have two collections.</p>
<p>Collection 1 is like an account.<br />
Collection 2 creates a unique association between a user and an account</p>
<p>I am trying to return the accounts for which the user has no association</p>
<p>Collection1 schema</p>
<pre><code>const Collection1Schema = new Schema({
  name: { type: String, required: true },
});
</code></pre>
<p>Collection1 data</p>
<pre><code>[
  {
    &quot;_id&quot;: &quot;61cf8452fca008360872c9cd&quot;,
    &quot;name&quot;: &quot;Aff 2&quot;
  },
  {
    &quot;_id&quot;: &quot;61cf845ffca008360872c9d0&quot;,
    &quot;name&quot;: &quot;AFF 1&quot;
  },
  {
    &quot;_id&quot;: &quot;61cf8468fca008360872c9d3&quot;,
    &quot;name&quot;: &quot;Aff 3&quot;
  }
]
</code></pre>
<p>Collection2 schema</p>
<pre><code>const Collection2Schema = new Schema({
  userID: { type: Schema.Types.ObjectId, required: true },
  col_1_ID: { type: Schema.Types.ObjectId, required: true },
});
</code></pre>
<p>Collection2 data</p>
<pre><code>[
  {
    &quot;_id&quot;: &quot;61e05bb5fe1d8327d4c73663&quot;,
    &quot;userID&quot;: &quot;61cf82dac828bd519cfd38ca&quot;,
    &quot;col_1_ID&quot;: &quot;61cf845ffca008360872c9d0&quot;
  },
  {
    &quot;_id&quot;: &quot;61e05c14fe1d8327d4c7367d&quot;,
    &quot;userID&quot;: &quot;61cf82dac828bd519cfd38ca&quot;,
    &quot;col_1_ID&quot;: &quot;61cf8468fca008360872c9d3&quot;
  },
  {
    &quot;_id&quot;: &quot;61e05ca0fe1d8327d4c73695&quot;,
    &quot;userID&quot;: &quot;61e05906246ccc41d4ebd30f&quot;,
    &quot;col_1_ID&quot;: &quot;61cf8452fca008360872c9cd&quot;
  }
]
</code></pre>
<p>This is what I have so far... but it does not return what the user is NOT apart of</p>
<p>I am using Collection2 as the basis in the pipeline</p>
<pre><code>[
  {
    '$match': {
      'userID': new ObjectId('61cf82dac828bd519cfd38ca')
    }
  }, {
    '$lookup': {
      'from': 'Collection1', 
      'localField': 'col_1_ID', 
      'foreignField': '_id', 
      'as': 'aa'
    }
  }, {
    '$unwind': {
      'path': '$aa', 
      'preserveNullAndEmptyArrays': true
    }
  }
]
</code></pre>
<p>What I would like to return is all the <strong>collection 1 documents</strong> ( where userIdD = '61cf82dac828bd519cfd38ca') is NOT associated in collection 2 ... like this :</p>
<pre><code>[
  {
    &quot;_id&quot;: &quot;61cf8452fca008360872c9cd&quot;,
    &quot;name&quot;: &quot;Aff 2&quot;
  }
]
</code></pre>
<p><strong>UPDATE 1</strong>
Here is a playground where <em>another user has joined another account</em>, so the pipeline does not return &quot;Aff 2&quot; like expected</p>
<p><a href="https://mongoplayground.net/p/W6W88_2MaI3" rel="nofollow noreferrer">https://mongoplayground.net/p/W6W88_2MaI3</a></p>
<p><strong>UPDATE 2</strong>
Here is a playground that almost does what I want... it's returning duplication &quot;AFF 2&quot; entries.</p>
<p><a href="https://mongoplayground.net/p/nTI3MKNPEmD" rel="nofollow noreferrer">https://mongoplayground.net/p/nTI3MKNPEmD</a></p>

