embedfield:
MongoDB partition window, getting the document where a field has the greatest value<p>I am translating some things from SQL into MongoDB.</p>
<p>I have a Mongo table set up where a document can contain lots of information. There are two ids, <code>id_1</code> and <code>id_2</code>. <code>id_2</code> has a default value of <code>-1</code>. There is a 1-&gt;n relationship between <code>id_1</code> and <code>id_2</code>. For instance, the data can look like:</p>
<pre><code>id_1   id_2   info
---- | ---- | ----
120   -1      'dont'
120   444     'show'
123   -1      'test'
124   -1      'hello'
125   -1      'world'
125   123     'oh wait'
126   -1      'help'
126   201     'me'
127   -1      'sql'
127   206     'hell'
</code></pre>
<p>I want to have a MongoDB query that gets the highest <code>id_2</code> associated with an <code>id_1</code>.</p>
<p>Here is what the answer should look like given <code>id_1</code> containing <code>(123,124,125,126,127)</code> and <code>id_2</code> containing <code>(-1,-1,123,201,206)</code>:</p>
<pre><code>id_1   id_2   info
---- | ---- | ----
123    -1     'test'
124    -1     'hello'
125    123    'oh wait'
126    201    'me'
127    206    'hell' 
</code></pre>
<p>In SQL this could be done using the following:</p>
<pre><code>WITH cte AS (
    SELECT *, ROW_NUMBER() OVER (PARTITION BY id_1 ORDER BY id_2 DESC) rn
    FROM ids
    WHERE id_1 IN (123, 124, 125, 126, 127) AND
          id_2 IN (-1, -1, 123, 201, 206)
)

SELECT id_1, id_2, info
FROM cte
WHERE rn = 1;
</code></pre>
<p>In Mongo this can be done with a <code>$group</code> clause, however, it is <strong>very</strong> slow. See below:</p>
<pre><code>{
      '$sort' : {
           'id_1': 1,
           'id_2': 1   
      }  
},
{
      '$group' : {
          '_id': '$id_1',
          'id_1': {'$first': '$id_1'},
          'info': { '$last': '$info'}
      }  
}
</code></pre>
<p>I found this in the documentation:</p>
<p><a href="https://docs.mongodb.com/manual/reference/operator/aggregation/setWindowFields/#std-label-setWindowFields-window" rel="nofollow noreferrer">https://docs.mongodb.com/manual/reference/operator/aggregation/setWindowFields/#std-label-setWindowFields-window</a></p>
<p>However, I'm not getting good results. I think I'm misunderstanding <code>window</code>. Here is what I have:</p>
<pre><code>    {
            '$match' : {
                'id_1': {'$in' : [123,124,125,126,127]},
                'id_2': {'$in' : [-1,-1,123,201,206]}
            }
    },
    {
        '$setWindowFields': {
            'partitionBy': 'id_1',
            'sortBy' : {
                'id_2': -1
            },
            'output': {
                'info': {
                    '$last': '$info'    
                },
            }
        }
    },
    {
        '$project' : {
            'id_1' : 1,
            'id_2' : 1,
            'info' : 1
        }
    }
</code></pre>
<p>This doesn't really seem to do anything except output every info for every combination of <code>id_1</code> and <code>id_2</code>. Similarly, adding a range of <code>[0,1]</code> to a <code>window</code> in the <code>output</code> just results in an error that says:</p>
<p><code>Missing _sortExpr with range-based bounds</code></p>
<p>Does anyone know how to get the same results that I got in SQL?</p>

