}
</code></pre>
<p>and another collection center_data as:</p>
<pre><code>{
    'authored_by': ObjectId('asdfs'),
    'books':{'name':'alpha'},
    'book_type':'adventure'
    'general':{'address':{'city':'ABC'}}
}

{
    'authored_by': ObjectId('jkfo21'),
    'books':{'name':'sigma'},
    'book_type':'drama'
    'general':{}
}
</code></pre>
<p>I want to fetch all the objects and get the details from the <code>center_data</code> collection:</p>
<p>Sample O/P:</p>
<pre><code>[
    {
        'authored_by':ObjectId('asdfs'),
        'general':{'address':{'city':'XYZ'}},
        'books':[
            {
               'address': 'ABC'
            }
        ]
    },
    {
        'authored_by':ObjectId('jkfo21'),
        'general':{'address':{'city':'YYZ'}},
        'books':[
            {
               'address': ''
            }
        ]
    }
]
</code></pre>
<p>For this I tried as::</p>
